import { camelCase } from 'jquery';
import React, { Component } from 'react';

class Inici extends Component {

    restaurant = React.createRef();
    especialitat = React.createRef();
    localitzacio = React.createRef();


    render() {
        return (
            <form>
                <div className="row">
                    <div className="form-group col-md-4">
                        <input ref={this.nom} type="email" className="form-control form-control-lg" placeholder="Nom restaurant" />
                    </div>
                    <div class="form-group col-md-4">
                        <label >Localitat</label>
                        <select id="poblacio" class="form-control" name="poblacio">
                            <option selected>Selecciona</option>
                        </select>
                    </div>
                    <div class="form-group col-md-4">
                        <label for="inputState">Especialitat</label>
                        <select id="especialitat" class="form-control" name="especialitat">
                            <option selected>Selecciona</option>
                        </select>
                    </div>
                    <div className="form-group col-md-4">
                        <input type="submit" className="btn btn-lg btn-danger btn-block" value="Cercar" />
                    </div>

                </div>
            </form>
        );
    }
}

export default Inici;
